function ListAndKey() {
    let Lang = ["Javascript", "Java", "C", "C++"];
    return (
        <>
            <h1>List & Keys in React js</h1>
            {
                Lang.map((l, index) => {
                    return <li key={index}>{l}</li>
                })
            }
        </>
    )
}

export default ListAndKey;

